import React,{Component} from 'react';
import './contact.css';
import 'tachyons';

class Contact extends Component {
  constructor() {
    super();
  }
  render(){

    return (
      <div>
        <div><h1>Contact Us</h1>
        <form method="post">
        <p for="name">Name :</p>
        <input class="input" type="text" name="name" id="name" onchange="nameValidate(event)"/>
        <p>Email :</p>
        <input class="input" type="email" name="email" onchange="mailValidate(event)"/>
        <p>Message :</p>
        <textarea class="input" name="textmessage" onchange="messageValidate(event)"></textarea>
        <div class="margin btns">
        <input class="submit-btn" type="button" onclick="submitValidate()" value="Confirm" id="confirm"/>
        <button class="submit-btn submit" type="submit" onclick="thanks()" id="submit">Submit </button>
        </div>
        </form>
        </div>
    </div>
    );
  }
}

export default Contact;
